window.bookSummaryJSON = "<p><b>#1 WORLDWIDE BESTSELLER • An intelligent, lightning-paced thriller set within the hidden chambers, tunnels, and temples of Washington, D.C., with surprises at every turn. • Don’t miss the Peacock original series Dan Brown’s </b><b><i>The Lost Symbol</i></b><b>!</b>&nbsp;</p> <p>Famed Harvard symbologist Robert Langdon answers an unexpected summons to appear at the U.S. Capitol Building. His plans are interrupted when a disturbing object - artfully encoded with five symbols - is discovered in the building. Langdon recognizes in the find an ancient invitation into a lost world of esoteric, potentially dangerous wisdom.&nbsp;&nbsp;&nbsp;</p> <p>When his mentor Peter Solomon - a long-standing Mason and beloved philanthropist - is kidnapped, Langdon realizes that the only way to save Solomon is to accept the mystical invitation and plunge headlong into a clandestine world of Masonic secrets, hidden history, and one inconceivable truth...all under the watchful eye of Dan Brown's most terrifying villain to date.&nbsp;&nbsp;</p>"; 
